import React from 'react'
import { Row, Col } from 'react-materialize'

const divStyle = {
  margin: '40px',
  background: 'black',
  border: '5px solid pink'
};
const pStyle = {
  fontSize: '15px',
  textAlign: 'center'
};

const SnippetView = ({snippet}) => (


    <div style={divStyle}>
      <p style={pStyle}>Get started with inline style</p>
    </div>
  );


export default SnippetView;
